		end
		
		if runData.redPlaneVisits and runData.redPlaneVisits > 1 and misc.director:getAlarm(1) > 1 then
			misc.director:setAlarm(1, math.max(misc.director:getAlarm(1) - 1 * runData.redPlaneVisits, 1))
		end
		
		for _, player in ipairs(obj.P:findAll()) do
			local playerData = player:getData()
			
			if playerData.beatingHeartHide then
				if player.visible == true then
					player.visible = false
				end
				playerData.beatingHeartHide = playerData.beatingHeartHide + 1
				if playerData.beatingHeartHide == 10 then
					player:set("hp", -9999999)
					player:set("lastHp", 0)
					player:set("hud_hp_last", 0)
				end
			end
		end
		for _, corpse in ipairs(obj.EfPlayerDead:findAll()) do
			corpse.visible = false
		end
		
		local pylon = obj.Pylon:find(1)
		if pylon and pylon:isValid() then
			local pylonData = pylon:getData()
			
			if pylonData.count > 0 then
				if runData.pylonTimer then
					Quest.setObjective("Escape the planet", "Protect the Pylon.", math.floor((3600 - runData.pylonTimer) / 60), 60, false)
					if runData.pylonData1 then
						Quest.setObjective("Escape the planet", "Continue...?", nil, nil, true)
					end
				else
					Quest.setObjective("Escape the planet", "Protect the Pylon.", nil, nil, true)
					runData.pylonData1 = true
					Quest.setObjective("Escape the planet", "Continue...?", nil, nil, false)
				end
			else
				misc.hud:set("objective_text", "Find a Silver Lining.")
			end

			round = pylonData.count
			
			local roundData = rounds[round]
			
			if roundData and runData.pylonTimer then
				if runData.pylonTimer == 3500 then
					if roundData.spawnVanguards then
						for i = 1, roundData.spawnVanguards do
							obj.ImpPortal:create(pylon.x - 300 - (i * 90), pylon.y - 150)
							obj.ImpPortal:create(pylon.x + 300 + (i * 90), pylon.y - 150)
						end
					end
				end
				
				if runData.pylonTimer > 0 then
					if misc.getTimeStop() == 0 and not runData.pylonDead then
						runData.pylonTimer = runData.pylonTimer - 1
					end
				else
					pylon:set("active", 0)
					runData.pylonTimer = nil
					if round == 7 then
						for _, player in ipairs(obj.P:findAll()) do
							player:getData().survivedWave = true
						end
					elseif round == 10 and not pylonData.musicStopped then
						Sound.setMusic(nil)
						pylonData.musicStopped = true
					end
				end
				
				for _, actor in ipairs(pobj.actors:findAll()) do
					if actor:get("team") ~= "player" and actor:get("target") then
						actor:set("target", pylon.id)
					end
					local object = actor:getObject()
					if object == obj.Imp or object == obj.ImpG then
						actor:set("x_range", 0)
						if actor.x < pylon.x - 500 then
							actor:set("moveRight", 1)
						elseif actor.x > pylon.x + 500 then
							actor:set("moveLeft", 1)
						end
					else
						if actor.x < pylon.x - 650 then
							actor:set("moveLeft", 0)
						elseif actor.x > pylon.x + 650 then
							actor:set("moveRight", 0)
						end
					end
				end
				
				local enemy = table.irandom(roundData.enemies)
				
				local directorAc = misc.director:getAccessor()
				--directorAc.count = 0
				directorAc.card_choice = enemy.id
				directorAc.points = enemy.cost * (0.7 + (0.3 * directorAc.enemy_buff))
				--if misc.director:getAlarm(1) == -1 then
					--misc.director:setAlarm(1, roundData.rate * 4)
				--end
			elseif roundData or round == 10 then
				local directorAc = misc.director:getAccessor()
				directorAc.points = 0
			end
		else
			obj.Pylon:create(3447, 1072)
		end
		
		if hudBoss and hudBoss:isValid() then
			local hudBossObject = hudBoss:getObject()
			local pylon = obj.Pylon:find(1)
			if hudBossObject ~= obj.Pylon and pylon and pylon:isValid() then
				misc.hud:set("boss_id", pylon.id)
			end
		end
	end
	
	if hudBoss and hudBoss:isValid() then
		local hudBossObject = hudBoss:getObject()
		if hudBossObject == obj.Pylon then
			preHealthColor = misc.hud:get("boss_hp_color")
			misc.hud:set("boss_hp_color", bossHealthColor.gml)
		elseif misc.hud:get("boss_hp_color") == bossHealthColor.gml then
			misc.hud:set("boss_hp_color", preHealthColor)
		end
	end
end)

table.insert(call.preHUDDraw, function()
	local w, h = graphics.getHUDResolution()
	
	local roundData = rounds[round]
	
	if roundData and runData.pylonTimer then
		blendAlpha = math.approach(blendAlpha, 1, 0.01)
	else
		blendAlpha = math.approach(blendAlpha, 0, 0.01)
	end
	
	if blendAlpha > 0 then
		graphics.color(Color.RED)
		graphics.alpha(blendAlpha * 0.1)
		graphics.setBlendMode("additive")
		graphics.rectangle(0, 0, w, h, false)
		graphics.setBlendMode("normal")
	end
end)
table.insert(call.onHUDDraw, function()
	local w, h = graphics.getHUDResolution()
	
	local roundData = rounds[round]
	
	if roundData then
		local timer = runData.pylonTimer and runData.pylonTimer > 0
		if round ~= 10 or timer then 
			graphics.color(Color.WHITE)
			graphics.alpha(1)
			graphics.print("Wave "..round, w * 0.5, h - 100, graphics.FONT_DEFAULT, graphics.ALIGN_MIDDLE, graphics.ALIGN_CENTRE)
		end
	end
end)


return stage, room